[[package]]
name = "ordereddict"
version = "1.1"
summary = ""

[[package]]
name = "py"
version = "1.4.34"
summary = "library with cross-python path, ini-parsing, io, code, log facilities"

[[package]]
name = "pycodestyle"
version = "2.3.1"
summary = "Python style guide checker"

[[package]]
name = "pyflakes"
